'''keys: Solutions:Similar: T:S:'''from typing import Listclass Solution:    def multiply(self, A: List[List[int]], B: List[List[int]]) -> List[List[int]]:        if not A or not B: return None        if len(B) != len(A[0]): return None        row_A = len(A); col_A = len(A[0]); col_B = len(B[0])        res = [[0 for _ in range(col_B)] for _ in range(row_A)]        for i, row in enumerate(A):            for j, valA in enumerate(row):                if valA: # nonzero                    for k, valB in enumerate(B[j]):                        if valB:                            res[i][k] += valA * valB        return res